import React from 'react';
import './App.css';

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './pages/Home';
import PrivacyPolicy from './pages/PrivacyPolicy';
//import TermsAndConditions from './TermsAndConditions';

const App = () => (
  <Router>
    <Switch>
      <Route path="/privacy">
        <PrivacyPolicy />
      </Route>
      {/* Uncomment the below Route when you have a TermsAndConditions component */}
      {/*<Route path="/terms">
        <TermsAndConditions />
      </Route>*/}
      <Route path="/">
        <Home />
      </Route>
    </Switch>
  </Router>
);

export default App;
